// src/components/Projects.js
import React, { useEffect, useState, useContext } from "react";
import { motion, AnimatePresence } from "framer-motion";
import ThemeContext from "../context/ThemeContext";
import { FiGithub, FiExternalLink, FiStar, FiGitBranch } from "react-icons/fi";

// Technology icons mapping
const techIcons = {
  'JavaScript': 'JS',
  'TypeScript': 'TS',
  'React': 'âš›ï¸',
  'Node.js': 'ðŸŸ¢',
  'Python': 'ðŸ',
  'HTML': 'ðŸŒ',
  'CSS': 'ðŸŽ¨',
  'Git': 'ðŸ“¦',
  'Docker': 'ðŸ³',
  'MongoDB': 'ðŸƒ',
  'Express': 'ðŸš€',
  'Next.js': 'â­ï¸',
  'Tailwind': 'ðŸŽ¨',
  'Sass': 'ðŸ’…',
  'Redux': 'ðŸ”´',
  'GraphQL': 'ðŸ”·',
  'TypeScript': 'ðŸ”·',
};

// Function to get language icon or abbreviation
const getLanguageIcon = (lang) => {
  return techIcons[lang] || 'ðŸ’»';
};

// Function to convert language name to CSS class name
const getLanguageClassName = (lang) => {
  if (!lang) return 'bg-gray-200 dark:bg-gray-700';

  const colorMap = {
    'JavaScript': 'bg-yellow-100 text-yellow-800 dark:bg-yellow-900 dark:text-yellow-200',
    'TypeScript': 'bg-blue-100 text-blue-800 dark:bg-blue-900 dark:text-blue-200',
    'React': 'bg-cyan-100 text-cyan-800 dark:bg-cyan-900 dark:text-cyan-200',
    'Node.js': 'bg-green-100 text-green-800 dark:bg-green-900 dark:text-green-200',
    'Python': 'bg-blue-100 text-blue-800 dark:bg-blue-900 dark:text-blue-200',
    'HTML': 'bg-orange-100 text-orange-800 dark:bg-orange-900 dark:text-orange-200',
    'CSS': 'bg-purple-100 text-purple-800 dark:bg-purple-900 dark:text-purple-200',
    'Docker': 'bg-blue-100 text-blue-800 dark:bg-blue-900 dark:text-blue-200',
    'MongoDB': 'bg-green-100 text-green-800 dark:bg-green-900 dark:text-green-200',
    'Express': 'bg-gray-100 text-gray-800 dark:bg-gray-700 dark:text-gray-200',
    'Next.js': 'bg-black text-white dark:bg-white dark:text-black',
    'Tailwind': 'bg-cyan-100 text-cyan-800 dark:bg-cyan-900 dark:text-cyan-200',
    'Sass': 'bg-pink-100 text-pink-800 dark:bg-pink-900 dark:text-pink-200',
    'Redux': 'bg-purple-100 text-purple-800 dark:bg-purple-900 dark:text-purple-200',
    'GraphQL': 'bg-pink-100 text-pink-800 dark:bg-pink-900 dark:text-pink-200',
  };

  return colorMap[lang] || 'bg-gray-100 text-gray-800 dark:bg-gray-700 dark:text-gray-200';
};

// Loading Skeleton Component
const ProjectSkeleton = () => (
  <div className="rounded-xl overflow-hidden bg-white dark:bg-gray-800 shadow-lg">
    <div className="h-48 bg-gray-200 dark:bg-gray-700 animate-pulse"></div>
    <div className="p-6">
      <div className="h-6 bg-gray-200 dark:bg-gray-700 rounded w-3/4 mb-4 animate-pulse"></div>
      <div className="h-4 bg-gray-200 dark:bg-gray-700 rounded w-full mb-2 animate-pulse"></div>
      <div className="h-4 bg-gray-200 dark:bg-gray-700 rounded w-5/6 mb-4 animate-pulse"></div>
      <div className="flex flex-wrap gap-2 mb-4">
        {[1, 2, 3].map((i) => (
          <div key={i} className="h-6 w-16 bg-gray-200 dark:bg-gray-700 rounded-full animate-pulse"></div>
        ))}
      </div>
      <div className="flex justify-between items-center mt-4 pt-4 border-t border-gray-200 dark:border-gray-700">
        <div className="h-4 bg-gray-200 dark:bg-gray-700 rounded w-24 animate-pulse"></div>
        <div className="h-8 w-8 bg-gray-200 dark:bg-gray-700 rounded-full animate-pulse"></div>
      </div>
    </div>
  </div>
);

const Projects = () => {
  const [repos, setRepos] = useState([]);
  const [languages, setLanguages] = useState({});
  const [isLoading, setIsLoading] = useState(true);
  const [hoveredCard, setHoveredCard] = useState(null);
  const { isDark } = useContext(ThemeContext);

  // Default project images
  const projectImages = {
    'portfolio': '/images/projects/portfolio.jpg',
    'ecommerce': '/images/projects/ecommerce.jpg',
    'blog': '/images/projects/blog.jpg',
    'dashboard': '/images/projects/dashboard.jpg',
    'api': '/images/projects/api.jpg',
    'mobile-app': '/images/projects/mobile.jpg',
  };

  // Function to fetch languages for a repository
  const fetchLanguages = async (repoName) => {
    try {
      const response = await fetch(`https://api.github.com/repos/TheOnlyBaddy/${repoName}/languages`);
      if (!response.ok) return [];
      const data = await response.json();
      return Object.keys(data);
    } catch (error) {
      console.error(`Error fetching languages for ${repoName}:`, error);
      return [];
    }
  };

  useEffect(() => {
    const fetchRepos = async () => {
      try {
        const response = await fetch("https://api.github.com/users/TheOnlyBaddy/repos");
        if (!response.ok) {
          throw new Error(`GitHub API error: ${response.status}`);
        }
        const data = await response.json();
        const filtered = Array.isArray(data) 
          ? data.filter(repo => !repo.fork && !repo.private)
          : [];

        setRepos(filtered);

        // Fetch languages for each repository
        const languagesData = {};
        for (const repo of filtered) {
          const repoLanguages = await fetchLanguages(repo.name);
          languagesData[repo.name] = repoLanguages;
        }
        setLanguages(languagesData);
      } catch (err) {
        console.error(err);
        setRepos([]);
      }
    };

    fetchRepos();
  }, []);

  return (
    <section id="projects"
      className={`py-16 transition-colors duration-500 ${
        isDark ? "bg-gray-900 text-white" : "bg-gray-50 text-gray-900"
      }`}
    >
      <div className="container mx-auto px-4 sm:px-6">
        <motion.h2 
          className="text-4xl font-bold mb-12 text-center"
          initial={{ opacity: 0, y: 20 }}
          whileInView={{ opacity: 1, y: 0 }}
          viewport={{ once: true }}
          transition={{ duration: 0.6 }}
        >
          My <span className="text-primary-600 dark:text-primary-400">Projects</span>
        </motion.h2>
        <div className="grid grid-cols-1 md:grid-cols-2 lg:grid-cols-3 gap-8">
          {repos.map((repo, index) => (
            <motion.div
              key={repo.id}
              className={`rounded-xl overflow-hidden shadow-lg transform transition-all duration-300 hover:shadow-2xl ${
                isDark ? "bg-gray-800 text-gray-200" : "bg-white text-gray-900"
              }`}
              initial={{ opacity: 0, y: 30 }}
              whileInView={{ opacity: 1, y: 0 }}
              viewport={{ once: true }}
              transition={{ duration: 0.5, delay: index * 0.1 }}
              whileHover={{ y: -5 }}
            >
              {/* Project Image */}
              <div className="h-48 overflow-hidden bg-gray-100 dark:bg-gray-700">
                <img 
                  src={projectImages[repo.name] || '/images/projects/default.jpg'} 
                  alt={repo.name}
                  className="w-full h-full object-cover transform hover:scale-105 transition-transform duration-500"
                  onError={(e) => {
                    e.target.src = '/images/projects/default.jpg';
                  }}
                />
              </div>
              <div className="p-6">
                <h3 className="text-xl font-bold mb-3 text-gray-900 dark:text-white">{repo.name}</h3>
              <div className="text-sm mb-5 text-gray-600 dark:text-gray-300">
                {repo.description ? (
                  <p className="line-clamp-3 mb-4">{repo.description}</p>
                ) : (
                  <p className="text-gray-500 italic">No description provided</p>
                )}

                {/* Technology Tags */}
                {languages[repo.name]?.length > 0 && (
                  <div className="mt-4">
                    <h4 className="text-sm font-medium mb-2 text-gray-700 dark:text-gray-300">
                      Technologies Used: 
                    </h4>
                    <div className="flex flex-wrap gap-2">
                      {languages[repo.name].map((lang) => {
                        const languageClass = getLanguageClassName(lang);
                        return (
                          <span 
                            key={lang}
                            className={`tech-tag ${languageClass}`}
                            title={lang}
                          >
                            {lang}
                          </span>
                        );
                      })}
                    </div>
                  </div>
                )}
              </div>
